import React, { Component } from 'react';
class Properties extends Component {
  constructor(props) {
    super(props);
    this.fetchPropertyDetails = this.fetchPropertyDetails.bind(this);
    this.state = {
        showDescription: false,
    };
  }

  fetchPropertyDetails = (e) => {
    console.log(this.props);
    const property = e.target.getAttribute('data-item');
    const { showDescription } = this.state;
    this.setState({
        showDescription: !showDescription,
    });
  }
  render() {
    const { showDescription } = this.state;
    return (
         <div>
            {!showDescription && (
                 <div>
                     <table>
                      <thead>
                        <tr>
                          <th>Id</th>
                          <th>Name</th>
                          <th>Address</th>
                          <th>City</th>
                          <th>State</th>
                          <th>Zip Code</th>
                          <th>County</th>
                          <th>Phone</th>
                          <th>Type</th>
                          <th>Capacity</th>
                        </tr>
                      </thead>
                      <tbody>
                          {this.props.properties.map((property, index) => (
                              <tr>
                                  <td>{property.id}</td>
                                  <td key={index} data-item={property.name} onClick={this.fetchPropertyDetails}
                                      style={{ textDecoration: 'underline', color: 'blue' }}
                                  >
                                      {property.name}
                                  </td>
                                  <td>{property.address}</td>
                                  <td>{property.city}</td>
                                  <td>{property.state}</td>
                                  <td>{property.zip_code}</td>
                                  <td>{property.county}</td>
                                  <td>{property.phone}</td>
                                  <td>{property.type}</td>
                                  <td>{property.capacity}</td>
                              </tr>
                            ))}
                       </tbody>
                     </table>
                 </div>
            )}
            {showDescription && (
                <div>
                    <img src={ require('./frontend/public/images/banyan_place/banyanplace_photos_06_seniorly_sd.png') } />
                </div>
            )}
         </div>
    );
  }
}
export default Properties;
